import React from "react"

function handleClick(){
    console.log("Clicked")
}

function App() {
    return(
        <div>
            <img onMouseOver={() => console.log("Hover!")} src="https://picsum.photos/200" />
            <br />
            <button onClick={handleClick}>Click me!</button>
        </div>
    )
}

export default App
